import React from 'react';

const Customize = () => {
    return (
        <div style={{display:"flex"}}>
            <div style={{border:"3px solid black", flex:"1"}}>
                <h1>Image</h1>
            </div>
            <div style={{border:"3px solid black", flex:"1"}}>
                <h1>Ingredients</h1>
            </div>
        </div>
    )
}

export default Customize;
